      out.write("    // Sidebar and navigation functionality\n");
      out.write("    let sideMenuBtns = document.querySelectorAll(\".sideMenuBtn\");\n");
      out.write("    const body = document.querySelector(\"body\");\n");
      out.write("    const navRadios = document.querySelectorAll('input[name=\"nav\"]');\n");
      out.write("\n");
      out.write("    sideMenuBtns.forEach((btn) => {\n");
      out.write("        btn.addEventListener(\"click\", () => {\n");
      out.write("            body.classList.toggle(\"sidebar-deactive\");\n");
      out.write("        });\n");
      out.write("    });\n");
      out.write("\n");
      out.write("    navRadios.forEach(radio => {\n");
      out.write("        radio.addEventListener('change', (event) => {\n");
      out.write("            const selectedValue = event.target.value;\n");
      out.write("            if (selectedValue) {\n");
      out.write("                window.location.href = selectedValue;\n");
      out.write("            }\n");
      out.write("        });\n");
      out.write("    });\n");
      out.write("\n");
      out.write("    // Payment and transfer popup functionality\n");
      out.write("    let currentRequestId = '';\n");
      out.write("\n");
      out.write("    function showPaymentPopup(requestId) {\n");
      out.write("        currentRequestId = requestId;\n");
      out.write("        document.getElementById('paymentPopup').style.display = 'flex';\n");
      out.write("    }\n");
      out.write("\n");
      out.write("    function closePaymentPopup() {\n");
      out.write("        document.getElementById('paymentPopup').style.display = 'none';\n");
      out.write("    }\n");
      out.write("\n");
      out.write("    function selectPaymentMethod(method) {\n");
      out.write("        closePaymentPopup();\n");
      out.write("        if (method === 'card') {\n");
      out.write("            window.location.href = 'card-payment.jsp?requestId=' + currentRequestId;\n");
      out.write("        } else if (method === 'bank') {\n");
      out.write("            showTransferPopup(currentRequestId);\n");
      out.write("        }\n");
      out.write("    }\n");
      out.write("\n");
      out.write("    function showTransferPopup(requestId) {\n");
      out.write("        currentRequestId = requestId;\n");
      out.write("        // Generate reference code\n");
      out.write("        document.getElementById('reference').value = 'DON-' + requestId + '-' + Math.floor(Math.random() * 10000);\n");
      out.write("        document.getElementById('banktransfer').style.display = 'flex';\n");
      out.write("    }\n");
      out.write("\n");
      out.write("    function closeTransferPopup() {\n");
