      out.write("        otherBankInput.style.display = this.value === 'other' ? 'block' : 'none';\n");
      out.write("        if (this.value !== 'other') {\n");
      out.write("            otherBankInput.value = '';\n");
      out.write("        }\n");
      out.write("    });\n");
      out.write("\n");
      out.write("    // Form submission handling\n");
